import React from 'react';
import Header from './components/header/header';
import VerticalNav from './components/VerticalNav/VerticalNav';
import './index.css';

const App = () => {
  return (
    <div className="App">
      <Header />
      <div className="main-content">
        <VerticalNav />
      </div>
    </div>
  );
};

export default App;
